  false,\n\t\"url\": null,\n\t\"notes\": \"This Inventory and Monitoring Plan for
  Seney NWR and Satellites is a step-down from the Habitat Management Plan (HMP) and
  documents the inventory and monitoring surveys that will be conducted from 2016
  through 2031, or until the refuge's Comprehensive Conservation Plan and HMP are
  revised. The majority of surveys considered in this plan address resource management
  objectives identified in the HMP for this refuge. Other surveys are a continuation
  of past monitoring conducted for the purpose of understanding long-term trends in
  specific resources or are part of regional and national survey efforts.\",\n\t\"license_title\":
